Ảnh bìa: 'Đi đâu mà zội mà zàng,
Vào “nhà” cô Sướng, sao đành đi za;
Mấy bạn chớ có lo xa,
Bánh tráng - gạo lứt – cookies - có đầy;
Chả cá 4 miếng thật dày,
Say ngào muối ớt- Me Lào ngất ngây;
Vào “in-bốp” cô Sướng ngay,
Chớp mắt 1 cái, hàng bay tới nhà!
